import React, {Component} from 'react';
import './App.css';
import Nav from './components/Nav'

class App extends Component{
  constructor(){
    super()
    this.state={
      players:[]
    }
  }
  render(){
    return(
      <>
        <div className='nav-title' >
          <Nav/>
        </div>
        <div>
          <h1>Hellooo</h1>
        </div>
      </>
    )
  }
}

export default App


